pragma solidity >=0.5.0;


contract DSM {
  string public name = "Decentralized Social Media";

  //store image hash
  uint public imageCount = 0;
  mapping(uint => Image) public images;

  struct Image {
    uint id;
    string hash;
    string description;
    uint tipAmount;
    address payable author;
